<script>  
//var svg = d3.select("svg").select("g")			//选择第一个g元素
//var svg = d3.select("svg").select(".st22")			//选择第一个st22类元素
//var met = d3.select("#text12809");			//选择id为text12809元素
var reas = {"pts":"20","galP":"30"};
//var reas = {"#text12176":"20","#text12809":"30"};
var x=[{r:"galP",v:"30"},{r:"pts",v:"20"}] //这种方法只能按元素出现顺序更新而不能基于反应名更新
var body = d3.select("body");
var svg = d3.select("svg");
d3.csv("flux.csv",function(error,rdata){
    if(error){
        console.log(error);
    } else { 
		var labels=new Array();
		for (key in rdata[0]){
			labels.push(key);
		}
		var rname=labels[0];
		var selectedflux=labels[0]; //缺省选择显示反应名称
//		labels.shift(); //去除第一个元素：反应名称
//		body.append("div")
//			.attr("class","clearfix")
		body.append("div") //定义选择按钮
			.attr("class","button-container")
			.selectAll("div").data(labels)
			.enter().append("div")
				.text(function(d) {return d;})
				.attr("class",function(d) {
					if(d==selectedflux)
						return "button selected";
					else
						return "button";
					})
				.on("click",function(d){ //点击后更改数据
					d3.select(".selected")
						.classed("selected",false);
					d3.select(this)
						.classed("selected",true);
					selectedflux=d;
					for (var i=0;i<rdata.length;i++){ //for in函数不行
						svg.selectAll("#"+rdata[i][rname])			//选择id为相应反应名的节点更改其值
							.text(rdata[i][selectedflux]);
//						console.log(selectedflux)
						}
					});
    }
});
//var svg = d3.select("svg");
width=svg.attr("width");
height=svg.attr("height");
svg.call(d3.downloadable({ //使新生成的svg文件可下载
	width: width,
	height: height,
	filename: "filename"
}));

</script>
